      console.log(blog);
      this.handleClick=()=>{
        blog.map((item)=>{
        return <div className={styles.blogCard} >
                   <Link to={item.link}> 
                        <img src='/assets/blog/slippage.png' alt='slippage'/>
                        <h4>{item.title}</h4>
                        </Link>
                    </div>
        // console.log(tempData)
